import React from 'react';
import AddUser from './Components/Users/AddUser';
import UsersList from './Components/Users/UsersList';

const DUMMY_LIST = [{name: 'mau',
                      age: '30'},
                      {
                      name: 'Ana',
                      age: '30'
                      }]



function App() {
  return (
    <div>
      <AddUser/>
      <UsersList users={DUMMY_LIST}/>
    </div>
  );
}

export default App;
